import React from "react";
import { Col, Container, Row } from "react-bootstrap";
import contact from "../assets/img/contact-img.svg";

const ContactUs = () => {
  return (
    <section className="contact">
      <Container>
        <Row>
          <Col md={6}>
            <img src={contact} alt="contact" />
          </Col>
          <Col md={6}>
            <h2>Get in toch</h2>
          </Col>
        </Row>
      </Container>
    </section>
  );
};

export default ContactUs;
